pragma solidity 0.5.16;

import './ERC721.sol';
import './ERC721Metadata.sol';
contract Diamond is ERC721, ERC721Enumerable, ERC721Metadata {
    address private admin;
    
    mapping(uint256 => DIAMOND_TOKEN) internal arts;
    
    struct DIAMOND_TOKEN {
      string entity;
      string name;
      string author;
      uint256 year;
      string extraData; // size, material, current state etc
    }
    
    modifier onlyAdmin {
        require(msg.sender == admin);
        _;
    }


    constructor () public ERC721Metadata("Diamond", "DMN") {
        admin = msg.sender;
    }
    
    function isExists(uint256 tokenId) view public returns(bool){
        return _exists(tokenId);
    }
    
    function passAdminRole(address to) public onlyAdmin returns(bool) {
        admin = to;
        return true;
    }
    function setArtToken(uint256 tokenId, string memory entity, string memory name, string memory author, uint256 year, string memory extraData) onlyAdmin public {
        require(_exists(tokenId), "Token doesn't exist");
        DIAMOND_TOKEN storage diamond = arts[tokenId];
        diamond.entity = entity;
        diamond.name = name;
        diamond.author = author;
        diamond.year = year;
        diamond.extraData = extraData;
    }
    function getArtToken(uint256 tokenId) public view returns(string memory, string memory, string memory, uint256, string memory) {
        require(_exists(tokenId), "Token doesn't exist");
        return (arts[tokenId].entity, arts[tokenId].name, arts[tokenId].author, arts[tokenId].year, arts[tokenId].extraData);
    }
    function getTokenIds() public view returns(uint256[] memory) {
        return super.getAllIndex();
    }
    function mint(address to, uint256 tokenId, string memory entity,
        string memory name, string memory author, uint256 year,
        string memory extraData) onlyAdmin public {
        super._mint(to, tokenId);
        setArtToken(tokenId, entity, name, author, year, extraData);
    }
    function burn(address owner, uint256 tokenId) onlyAdmin public {
        super._burn(owner, tokenId);
    }
    function setTokenURI(uint256 tokenId, string memory uri) onlyAdmin public {
        super._setTokenURI(tokenId, uri);
    }
}
